import React from 'react'
import { Link } from 'react-router-dom';

const EVENTS = [
  { id: "e1", title: "Event 1" },
  { id: "e2", title: "Event 2" },
  { id: "e3", title: "Event 3" },
];



const Events = () => {
  return (
    <>
      <h1>Events</h1>
      <ul>
      {EVENTS.map((event)=> (
        <li key={event.id}><Link></Link>{event.title}</li>
      ))}
      </ul>
    </>
  );
}

export default Events
